import React from "react";
import { useState } from "react";
import '../style.css';
import * as color from '../colors.js';
function Import(){
    return(
        <>
            <div style={{
            width:"100%"
            }}>
                <div>
                    <h2 style={{marginTop:"0",color:color.contrast}}>IMPORT / ADD ITEMS</h2>
                </div>
                <div style={{
                    margin:"auto",
                    marginTop:"4em"
                }}>
                    <table style={{
                        margin:"auto",
                        width:"70%",
                        borderSpacing:"0"
                    }}>
                    <tr>
                        <td className="td">
                        <label>
                            Item  
                        </label>
                        </td>
                        <td className="td">
                            :
                        </td>
                        <td className="td-add">
                        <input
                        className="inputitem"/>
                        </td>
                    </tr>
                    </table>
                </div>
            </div>
        </>
    );
}
export default Import;
